import React, { useState, useEffect } from 'react';
import axios from 'axios';


function App() {

  // new line start
 const [profileData, setProfileData] = useState(null)

 function getData() {
  axios.get('/top_films')
    .then(response => {
      const topFilmsData = response.data;
      // Assuming the response data is an array of film objects
      setProfileData(topFilmsData);
    })
    .catch(error => {
      console.error('Error fetching top films data:', error);
    });
}


return (
  <div className="App">
    <header className="App-header">
      <img src={logo} className="App-logo" alt="logo" />
      <p>
        Edit <code>src/App.js</code> and save to reload.
      </p>
      <a
        className="App-link"
        href="https://reactjs.org"
        target="_blank"
        rel="noopener noreferrer"
      >
        Learn React
      </a>

      <p>To get top films data: </p><button onClick={getData}>Click me</button>
      {profileData && (
        <div>
          <h2>Top Films</h2>
          <ul>
            {profileData.map(film => (
              <li key={film.film_id}>
                <p>Title: {film.title}</p>
                <p>Rental Count: {film.rental_count}</p>
                <p>Description: {film.description}</p>
                <p>Release Year: {film.release_year}</p>
                <p>Rating: {film.rating}</p>
                <p>Average Rental Cost: {film.average_rental_cost}</p>
              </li>
            ))}
          </ul>
        </div>
      )}
    </header>
  </div>
);

}

export default App;
